package com.enez.market.event;

public class EventDTO {
	String event_title, event_img, event_content, event_state, event_sday, event_fday;
	int event_no, event_cnt;
	public EventDTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getEvent_title() {
		return event_title;
	}
	public void setEvent_title(String event_title) {
		this.event_title = event_title;
	}
	public String getEvent_img() {
		return event_img;
	}
	public void setEvent_img(String event_img) {
		this.event_img = event_img;
	}
	public String getEvent_content() {
		return event_content;
	}
	public void setEvent_content(String event_content) {
		this.event_content = event_content;
	}
	public String getEvent_state() {
		return event_state;
	}
	public void setEvent_state(String event_state) {
		this.event_state = event_state;
	}
	public String getEvent_sday() {
		return event_sday;
	}
	public void setEvent_sday(String event_sday) {
		this.event_sday = event_sday;
	}
	public String getEvent_fday() {
		return event_fday;
	}
	public void setEvent_fday(String event_fday) {
		this.event_fday = event_fday;
	}
	public int getEvent_no() {
		return event_no;
	}
	public void setEvent_no(int event_no) {
		this.event_no = event_no;
	}
	public int getEvent_cnt() {
		return event_cnt;
	}
	public void setEvent_cnt(int event_cnt) {
		this.event_cnt = event_cnt;
	}
	
	
}
